import React from "react"


function RandomRecipes(props){ 
        const {recipe} = props
        console.log(props)
    return ( 
        <div className ="main-home"> 
                {recipe.recipe && recipe.recipe.recipes.map(recipe => 
                <>
                <h1>{recipe.title}</h1>
                <span>Ready in {recipe.readyInMinutes}</span>
                <span>Serves {recipe.servings}</span>
                <img src = {recipe.image}></img>
                {recipe.extendedIngredients.map(ingredient => <ul>{ingredient.original}</ul>)}
                {recipe.analyzedInstructions[0].steps.map(step => <ul>{step}</ul>)} 
                </>
                    )}

        </div>
    )
}

export default RandomRecipes
